import React from "react";

export const Tile = ({ name, email, phone }) => {
  return (
    <div className="tile-container">
      <div></div>
      <p className="tile-title">Name: {name}</p>
      <p className="tile">Email: {email}</p>
      <p className="tile">Phone: {phone}</p>
    
    </div>
  );
};
